import { $, component$, useContext, useSignal, useStylesScoped$, useVisibleTask$, useTask$  } from "@builder.io/qwik";
import type { DocumentHead } from "@builder.io/qwik-city";
import { useNavigate } from '@builder.io/qwik-city';
import { Loading } from "~/components/starter/loading/Loading";
import { QuotesEngineSteps } from "~/components/starter/quotes-engine/QuotesEngineSteps";
import { Form } from "~/components/starter/form/Form";
import { WEBContext } from "~/root";
import { DIVISAContext } from "~/root";
import { CardPaymentResume } from "~/components/starter/card-payment-resume/CardPaymentResume";

import styles from './index.css?inline'
import { SwitchDivisa } from "~/components/starter/switch/SwitchDivisa";

export const head: DocumentHead = {
    title : 'Continental Assist | Resumen de compra',
    meta : [
        {name:'robots',content:'index, follow'},
        {name:'title',content:'Continental Assist | Resumen de compra'},
        {name:'description',content:'Paso 3 - Resumen de compra. Continental Assist te ayuda a tener todo listo para tu viaje. Un plan de asistencia para que conectes con la tranquilidad.'},
        {property:'og:title',content:'Continental Assist | Resumen de compra'},
        {property:'og:description',content:'Paso 3 - Resumen de compra. Continental Assist te ayuda a tener todo listo para tu viaje. Un plan de asistencia para que conectes con la tranquilidad.'},
    ],
    links: [
        {rel:'canonical',href:'https://continentalassist.com/quotes-engine/step-3'},
    ],
}

declare global {
    interface Window {
      OpenPay: any;
    }
  }

export default component$(() => {
    useStylesScoped$(styles)

    const stateContext = useContext(WEBContext)
    const contextDivisa = useContext(DIVISAContext)

    const navigate = useNavigate()

    const objectResume : {[key:string]:any} = {}

    const resume = useSignal(objectResume)
    const messageCupon = useSignal({error:'',cupon:{codigocupon:'',idcupon:0,porcentaje:0}})
    const loading = useSignal(true)
    const divisaManual = useSignal(contextDivisa.divisaUSD)
    const desktop = useSignal(false)

    const array : any[] = []
    const paymentMethods = useSignal([
        {origin:'US',list:[
            {
                method:'CC',
                title:'Crédito / Débito',
                icons:[
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,'
                ]
            },
        ]},
        {origin:'MX',list:[
            {
                method:'CARD',
                title:'Crédito / Débito',
                icons:[
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,'
                ]
            },            
            /* {
                method:'STORE',
                title:'Pago en comercio',
                icons:[],
                fontawesome:'fa-solid fa-store fa-xl text-dark-blue'

            },
            {
                method:'BANK_ACCOUNT',
                title:'Pago en banco',
                icons:[],
                fontawesome:'fa-solid fa-building-columns fa-xl text-dark-blue'
            },
            {
                method:'CARD_REDIRECT',
                title:'Transferencia',
                icons:[],
                fontawesome:'fa-solid fa-money-bill-transfer fa-xl text-dark-blue'
                   
                
            } */
        ]},
        {origin:'CO',list:[
            {
                method:'CARD',
                title:'Crédito / Débito',
                icons:[
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,',
                    'data:image/svg+xml;base64,'
                ]
            },
            {
                method:'BANCOLOMBIA_TRANSFER',
                title:'Transferencia Bancolombia',
                icons:['data:image/svg+xml;base64,']
            },
            {
                method:'BANCOLOMBIA_QR',
                title:'QR Bancolombia',
                icons:['data:image/svg+xml;base64,']
            },
            
            {
                method:'NEQUI',
                title:'NEQUI',
                icons:['data:image/png;base64,']
            },
            {
                method:'PSE',
                title:'PSE',
                icons:['data:image/png;base64,']
            },
          /*   {
                method:'BANCOLOMBIA_COLLECT',
                title:'Efectivo',
                icons:['data:image/svg+xml;base64,']
            }, */
            
        ]},
    ])
    const listPaymentMethods = useSignal(array)

    // eslint-disable-next-line qwik/no-use-visible-task
    useVisibleTask$(() => {        
        if(!navigator.userAgent.includes('Mobile'))
        {
            desktop.value = true
        }
    })
    // eslint-disable-next-line qwik/no-use-visible-task
    useVisibleTask$(() => {        
        if(Object.keys(stateContext.value).length > 0)
        {
            
            resume.value = stateContext.value
            loading.value = false
        }
        else
        {
            navigate('/quotes-engine/step-1')
        }
    })

    function buildMethodsButtons(){

    if (stateContext?.value?.total?.total >0) {
        if(divisaManual.value == true &&Object.keys(stateContext.value).length > 0)
            {
                listPaymentMethods.value = paymentMethods.value[0].list
            }
            else 
            {
                paymentMethods.value.map((payment) => {
                    if(stateContext?.value?.resGeo?.country == payment.origin)
                    {
                        listPaymentMethods.value = payment.list
                    }
                })
            }

        
    }
           
    }

    buildMethodsButtons()
    useTask$(() => {
        if(Object.keys(stateContext.value).length > 0)
        {
            resume.value = stateContext.value    
            loading.value = false
        }
       
    })


    const getCupon$ = $(async() => {
        const input = document.querySelector('#input-cupon') as HTMLInputElement

        if(input.value != '')
        {
            const resGeo = await fetch('https://us-central1-db-service-01.cloudfunctions.net/get-location')
                .then((response) => {return(response.json())})

            if(resGeo.ip_address != '' || resGeo.ip_ != undefined)
            {
                const dataRequest = {
                    idplan:resume.value.plan.idplan,
                    codigocupon:input.value,
                    ip:resGeo.ip_address
                }
                
                let resCupon : {[key:string]:any} = {}

                const resCuponValid = await fetch("/api/getCupon",{method:"POST",body:JSON.stringify(dataRequest)});
                const dataCupon = await resCuponValid.json()
                resCupon = dataCupon
    
                if(resCupon.error == false)
                {
                    const newResume = Object.assign({},resume.value)
                    const discount = newResume.total.total * parseFloat("0." + Number(resCupon.resultado[0].porcentaje))
                    const newTotal = newResume.total.total - discount
                    
                    newResume.subTotal = newResume.total.total
                    newResume.total = {divisa:newResume.total.divisa,total:newTotal}

                    resume.value = newResume

                    messageCupon.value = {error:'success',cupon:resCupon.resultado}
                }
                else
                {
                    messageCupon.value = {error:'error',cupon:{codigocupon:input.value,idcupon:0,porcentaje:0}}
                }
            }
        }
    })

    const getPaymentMethod$ = $( async(method:string) => {
        const newResume = Object.assign({},resume.value)
        newResume.cupon = messageCupon.value.cupon;
        if(stateContext.value.resGeo.country == 'CO')
        {
            newResume.wompiTipo = method
        }
        else if(stateContext.value.resGeo.country == 'MX')
        {
            newResume.openPayTipo = method
        }
        else
        {
            newResume.authorizeTipo = method
        }
        


        (window as any)['dataLayer'].push(
            Object.assign({
                'event': 'TrackEventGA4',
                'category': 'Flujo asistencia',
                'action': 'Paso 4 :: resumen de compra',
                'origen': newResume.paisorigen,
                'destino': newResume.paisesdestino,
                'desde': newResume.desde,
                'hasta': newResume.hasta,
                'adultos': newResume[70],
                'niños_y_jovenes': newResume[23],
                'adultos_mayores': newResume[85],
                'page': '/quotes-engine/step-3',
                'option': newResume.plan.nombreplan,
                'descuento': newResume.cupon.porcentaje,
                'cupon': newResume.cupon.codigocupon,
                'total': Math.ceil(newResume.total.total),
                'cta': 'ir a pagar',
            },stateContext.value.dataLayerPaxBenefits)
        );

        stateContext.value = newResume

        await navigate('/quotes-engine/step-4')
        
    })
    const sendQuote$ = $((e:any) => {
        const form = document.querySelector('#form-send') as HTMLElement

        if(e.target.checked == false)
        {
            form.classList.add('d-none')
        }
        else
        {
            form.classList.remove('d-none')
        }
    })

    const getSendQuote$ = $(async() => {
        const form = document.querySelector('#form-send-quote') as HTMLFormElement
        const inputs = Array.from(form.querySelectorAll('input'))
        const bs = (window as any)['bootstrap']
        const toastSuccess = new bs.Toast('#toast-success',{})
        const toastError = new bs.Toast('#toast-error',{})
        let error = false
        const dataForm : {[key:string]:any} = {}

        if(!form.checkValidity())
        {
            form.classList.add('was-validated')
            error = true
        }
        else
        {
            form.classList.remove('was-validated')
            
            inputs.map((input) => {
                dataForm[(input as HTMLInputElement).name] = (input as HTMLInputElement).value
            })
        }

        if(error == false)
        {
            const planescotizados : any[] = []

            resume.value.planescotizados.map((plan:any) => {
                planescotizados.push({idplan:plan.idplan,precio:plan.precio_grupal})
            })

            dataForm.cotizacion = { 
                fecha:{desde:resume.value.desde,hasta:resume.value.hasta,dias:resume.value.dias}, 
                origen:resume.value.origen,
                destinos:resume.value.destinos,
                pasajeros:resume.value.asegurados, 
                planfamiliar:resume.value.planfamiliar, 
                plan:{idplan:resume.value.plan.idplan,nombreplan:resume.value.plan.nombreplan,precio:resume.value.plan.precio_grupal}, 
                total:resume.value.total.total, 
                moneda:{codigomoneda:resume.value.total.divisa}, 
                planescotizados:planescotizados, 
                contacto:resume.value.contacto, 
                edades:resume.value.edades
            }

            let resQuote : {[key:string]:any} = {}

            const resSendQuote = await fetch("/api/getSendEmailQuote",{method:"POST",body:JSON.stringify(dataForm)});
            const dataSendQuote = await resSendQuote.json()
          
            resQuote = dataSendQuote

            if(resQuote.error == false)
            {
                toastSuccess.show()
            }
            else
            {
                toastError.show()
            }
        }
    })

    const changeDivisa$ = $((divisa:string) => {
        if(divisa == 'base')
        {
            contextDivisa.divisaUSD = true
            divisaManual.value  = true
        }
        else if(divisa == 'local')
        {
            contextDivisa.divisaUSD = false
            divisaManual.value  = false
        }
    })

    return(
        <div class='container-fluid px-0' style={{paddingTop:'78px'}}>
        {
            loading.value === true
            &&
            <Loading/>
        }

            <div class='row not-mobile'>
                <div class='col-12'>
                    <div class={desktop.value == true ? 'container-fluid steps-float' : 'container'}>
                        <div class='row'>
                            <div class='col-12'>
                                <div class='container'>
                                    <div class={desktop.value == true ? 'row justify-content-end mx-0' : 'row'}>
                                        
                                        <div class='col-md-3  d-flex  justify-content-end'>
                                            <QuotesEngineSteps active={3} name={'Método'} steps={5}/>
                                        </div>
                                        
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <div class='row mobile  text-center justify-content-center align-items-center' >
            <hr class='m-0' />
                <div class='col-xs-12 d-flex justify-content-center align-items-center '  style={{padding:'20px'}} >
                    <QuotesEngineSteps  active={3} name={'Método'} steps={5}/>
                </div>

              
            </div>

            <div class='container-fluid'>
                <div class='row bg-step-5'>
                    <div class='col-xl-12'>
                        <div class='container'>
                            <div class='row  justify-content-center'>
                            <div class='col-lg-10 text-center mt-5 mb-3'>
                                    <h1 class='text-semi-bold text-blue'>
                                        <span class='text-tin'>Todo listo </span><br class='mobile'/> para tu viaje
                                    </h1>
                                    <hr class='divider my-3'/>
                              </div>
                            </div>

                            <br/>
                            <div class="row">
                                <div class='col-lg-12 col-xl-12'>
                                    
                                        <CardPaymentResume>
                                        {
                                        stateContext?.value?.total?.total >0&&
                                        <div class='container px-2 pt-4 pb-2'>
                                                <div class='row mb-4'>
                                                    <div class='col-lg-12'>
                                                        <div class='container'>
                                                            
                                                            <div class='row row-mobile'>
                                                                <div class='col-xl-10 col-sm-12 col-12'>
                                                                    <input 
                                                                        id='input-cupon' 
                                                                        name='cupon' 
                                                                        type='text' 
                                                                        class='form-control text-center' 
                                                                        placeholder="¿Tienes un cupón?"
                                                                        disabled={messageCupon.value.error == 'success'}
                                                                       // onBlur$={getCupon$}
                                                                    />

                                                                </div>
                                                                
                                                                <div class='col-xl-2 col-sm-12 col-12'>
                                                                <div class='d-grid gap-2 '>
                                                                <button type='button' class='btn btn-primary' onClick$={getCupon$}>Aplicar</button>

                                                                </div>
                                                                    
                                                                <br/>

                                                                </div>
                                                               
                                                                <hr/>
                                                                {
                                                                    messageCupon.value.error != ''
                                                                    &&
                                                                    <div class='col-lg-12 mt-3'>
                                                                        {
                                                                            messageCupon.value.error == 'error'
                                                                            &&
                                                                            <div class="alert alert-danger text-semi-bold text-blue mb-0" role="alert">
                                                                                Cupón <span class='text-semi-bold text-danger'>{messageCupon.value.cupon.codigocupon} no es valido!</span>
                                                                            </div>
                                                                        }
                                                                        {
                                                                            messageCupon.value.error == 'success'
                                                                            &&
                                                                            <div class="alert alert-success text-semi-bold text-blue mb-0" role="alert">
                                                                                Cupón <span class='text-semi-bold text-success'>{messageCupon.value.cupon.codigocupon}</span> aplicado con exito!
                                                                            </div>
                                                                        }
                                                                    </div>
                                                                }


                                                                
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                                <div class="container  not-mobile">
                                                    <div class='row'>
                                                        <p class=' text-semi-bold text-blue  text-end'> Selecciona método de pago</p>
                                                                                                        
                                                            {
                                                                listPaymentMethods.value.map((payment:any,index:number) => {
                                                                    
                                                                    return(
                                                                        
                                                                    <div key={index}class='col-lg-4 col-md-6 g-0 d-flex align-items-center'>
                                                                        <div class='d-flex justify-content-center align-items-center text-center ' style={{border:'2px solid lightgray',minWidth:'72px', width:'72px', height:'46px', borderRadius:'10px', margin:'5px',cursor:'pointer' }} onClick$={() => {getPaymentMethod$(payment.method);}}>
                                                                            {
                                                                                payment.icons.length>0 
                                                                                &&
                                                                                payment.icons.map((icon:any,iIcon:number) => {
                                                                                    if (payment.title == 'Crédito / Débito' && iIcon ==0) {
                                                                                        return(<img key={index+'-'+iIcon} class='d-block' src={icon} width={'30'} height={'20'} />)
                                                                                    }
                                                                                    if (payment.title == 'Crédito / Débito') {
                                                                                        return(<img key={index+'-'+iIcon} class='' src={icon} width={'20'} height={'20'} />)
                                                                                    } 
                                                                                    else{
                                                                                        return(<img key={index+'-'+iIcon} class='' src={icon} width={'30'} height={'30'} />)
                                                                                    }
                                                                                    
                                                                                })
                                                                            }
                                                                            {
                                                                                'fontawesome'in payment && payment.fontawesome.length>0 &&
                                                                                <i class={payment.fontawesome}/>
                                                                            }
                                                                        </div>   
                                                                        <p class="text-decoration-none text-dark-blue mt-3">{payment.title}</p>                                                                                    
                                                                    </div>

                                                                    )
                                                                })
                                                            }
                                                    </div>
                                                </div>

                                               

                                                <div class='container mobile'>
                                                    <div class="row d-flex justify-content-center">

                                                    <p class=' text-semi-bold text-blue  text-center'> Selecciona método de pago</p>
                                                   
                                                                                              
                                                   {
                                                       listPaymentMethods.value.map((payment:any,index:number) => {
                                                           
                                                           return(
                                                              
                                                           <div key={index}class='col-lg-4 col-md-6 col-sm-6 col-xs-4 g-0 align-self-center text-center'>
                                                              <p class="title-method text-medium text-decoration-none text-dark-blue mt-3">{payment.title}</p>  
                                                               <div class='icons' style={{border:'2px solid lightgray',borderRadius:'10px', padding:'9px',margin:'5px',cursor:'pointer' }} onClick$={() => {getPaymentMethod$(payment.method);}}>
                                                                   {
                                                                       payment.icons.length>0 
                                                                       &&
                                                                       payment.icons.map((icon:any,iIcon:number) => {
                                                                           return(<img key={index+'-'+iIcon}  src={icon} width={'17'} height={'17'} />)
                                                                       })
                                                                   }
                                                                   {
                                                                       'fontawesome'in payment && payment.fontawesome.length>0 &&
                                                                       <i class={payment.fontawesome}/>
                                                                   }
                                                               </div>   
                                                           </div>
     
                                                           )
                                                       })
                                                   }
                                                    </div>
                                                   
                                                    
                                                </div>

                                                <br/>
                                                <div class="payment">
                                                <SwitchDivisa
                                                labels={['USD',stateContext.value?.currentRate?.code]}
                                                value={contextDivisa.divisaUSD ? 'base' : 'local'}
                                                onChange={$((e:any) => {changeDivisa$(e)})}
                                            />
                                                {
                                                        resume.value.idcotizacion == undefined
                                                        &&
                                                        <div class='col-lg-12 col-md-12 col-12 ps-3'>
                                                        <div id='buttons' class='row row-mobile mt-4 '>                                                                    
                                                                <div class="form-check form-check-inline">
                                                                    <input 
                                                                        class="form-check-input" 
                                                                        type="checkbox" 
                                                                        id={"send-quote"} 
                                                                        name='sendquote' 
                                                                        onClick$={(e) => {sendQuote$(e)}}
                                                                    />
                                                                    <label class="form-check-label" for={"send-quote"}>Enviar cotización</label>
                                                                </div>
                                                            </div>
                                                        </div>
                                                    }

                                                    <div id='form-send' class='row mt-3 d-none'>
                                                    <hr/>
                                                        <div class='col-lg-12'>
                                                            <Form 
                                                                id='form-send-quote'
                                                                form={[{row:[
                                                                    {size:'col-lg-6',type:'text',label:'Nombre',placeholder:'Nombre',name:'nombre',required:true},
                                                                    {size:'col-lg-6',type:'email',label:'Correo',placeholder:'Correo', name:'correo',required:true}
                                                                ]}]}
                                                            />
                                                        </div>
                                                        <div class='col-lg-2 col-md-6 col-12'>
                                                            <div class='d-grid gap-2'>
                                                                <label for='btnSendQuote'></label>
                                                                <button id='btnSendQuote' class='btn btn-success btn-lg mt-4' onClick$={getSendQuote$}>Enviar</button>
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                                

                                            </div>
                                        }
                                            
                                        </CardPaymentResume>                         
                                </div>
                            </div>
                            <br/>
                        </div>
                    </div>
                </div>
            </div>

            <div class="toast-container position-fixed bottom-0 p-3">
                <div id='toast-success' class="toast align-items-center text-bg-success border-0" role="alert" aria-live="assertive" aria-atomic="true">
                    <div class="d-flex">
                        <div class="toast-body">
                            <div class='message'>
                                <i class="fas fa-check-circle"/>
                                <span  class='text-start'>
                                    <b>Tu cotizacion se ha enviado!</b>
                                    <br/>
                                    <small>Por favor revisa tu bandeja de entrada o spam.</small>
                                </span>
                            </div>
                        </div>
                        <button type="button" class="btn-close btn-close-white me-2 m-auto" data-bs-dismiss="toast" aria-label="Close"></button>
                    </div>
                </div>
                <div id='toast-error' class="toast align-items-center text-bg-danger border-0" role="alert" aria-live="assertive" aria-atomic="true">
                    <div class="d-flex">
                        <div class="toast-body">
                            <div class='message'>
                                <i class="fas fa-times-circle"/>
                                <span class='text-start'>
                                    <b>Ocurrio un error!</b>
                                    <br/>
                                    <small>Si el error persiste llama a nuestros números de contacto.</small>
                                </span>
                            </div>
                        </div>
                        <button type="button" class="btn-close btn-close-white me-2 m-auto" data-bs-dismiss="toast" aria-label="Close"></button>
                    </div>
                </div>
            </div>

        </div>
    )
})